import React, {useState} from 'react';

const Socials = (props) => {

		const dataLocal = props.dataLocal

		const [socialsTab, setSocialsTab] = useState([
		{id:'Discord', link:'https://discord.com/invite/WZMFE5W'},
		{id:'Youtube', link:'https://www.youtube.com/channel/UCsTBtbUxAVwsLF8devi7aUA?view_as=subscriber'},
		{id:'Instagram', link:'https://www.instagram.com/tarayahworld/?hl=en'},
		{id:'Twitter', link:'https://twitter.com/TarayahWorld'},
		{id:'Twitch', link:'https://www.twitch.tv/tarayah'},
		{id:'Etsy', link:'https://www.etsy.com/fr/shop/TarayahWorld'}
		])

		const display = (
				<div>
				<div className='infoCategory'>
				{dataLocal.category}
				</div>
				<div className='infoTitle'>
				{dataLocal.title}
				</div>
				{socialsTab.map(social => (
						<a key={social.id} href={social.link}  target='_blank' rel="noopener noreferrer">
						<div className='socialsDot'/>
						<div className={'socials' + social.id}>
						{social.id}
						</div>
						</a>
				))}
				</div>
		)

		return (
				<div>
						{display}
				</div>
		)
}
export default Socials;
